import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();

  // Logout Function
  const handleLogout = () => {
    localStorage.removeItem("authToken"); // Remove authentication token
    navigate("/login"); // Redirect to login page
  };

  return (
    <nav className="bg-blue-600 p-4 shadow-lg">
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-white text-xl font-bold">User Dashboard</h1>
        
        <ul className="flex space-x-6">
          <li>
            <Link to="/settings" className="text-white hover:underline">
              Settings
            </Link>
          </li>
          <li>
            <Link to="/feedback" className="text-white hover:underline">
              Feedback
            </Link>
          </li>
          <li>
            <button 
              onClick={handleLogout} 
              className="text-white hover:underline bg-red-500 px-3 py-1 rounded"
            >
              Logout
            </button>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
